import string
class Solution(object):
    def lengthOfLongestSubstring(s):
        i = maxLen = 0
        position = [-1]*256
        for j in range(len(s)):
            if position[ord(s[j])] >= i:
                i = position[ord(s[j])] + 1
            position[ord(s[j])] = j
            maxLen = max(maxLen,j-i+1)
        return maxLen

